protected Version loadVersion() throws Exception {
  Version version = null;
  try {
    byte[] data = db.get(bytes(VERSION_NODE));
    if (data != null) {
      version = new VersionPBImpl(VersionProto.parseFrom(data));
    }
  } catch (DBException e) {
    throw new IOException(e);
  }
  return version;
}
